import React from "react";
import '../Css/Sidebar.css'

function Sidebar(){
    return 
    <div>
        <ul className='categoryTab'>
            {['About', 'Members'].map(cate => {
                return (
                    <Li key={cate}>
                        <Link to={'/home/'}>{cate}</Link>
                    </Li>
                );
            })}
        </ul>
        </div>
}

export default Sidebar;
